import React from "react";
import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker
} from "react-google-maps";
const {
  MarkerClusterer
} = require("react-google-maps/lib/components/addons/MarkerClusterer");

const Map = (startLoc, isMarkerShown, markers) => {
  return withScriptjs(
    withGoogleMap(props => (
      <GoogleMap
        defaultZoom={12}
        center={{
          lat: startLoc.lat,
          lng: startLoc.lng
        }}
        onDragend={props.centerMoved}
        onClick={props.handleClickedMap}
      >
        <MarkerClusterer averageCenter enableRetinaIcons gridSize={15}>
          {isMarkerShown &&
            markers.map(marker => (
              <Marker
                position={{
                  lat: marker.latitude,
                  lng: marker.longtitude
                }}
              />
            ))}
        </MarkerClusterer>
      </GoogleMap>
    ))
  );
};

export default Map;

